import React from "react";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <footer id="footer" className="py-4  text-black-50 fixed-bottom">
      <div>
        <a href="https://www.facebook.com">
          <i className="fa fa-facebook-square fa-3x social"></i>
        </a>
        <a href="https://twitter.com/bootsnipp">
          <i className="fa fa-twitter-square fa-3x social"></i>
        </a>
        <a href="https://plus.google.com/+Bootsnipp-page">
          <i className="fa fa-google-plus-square fa-3x social"></i>
        </a>
        <a href="mailto:bootsnipp@gmail.com">
          <i className="fa fa-envelope-square fa-3x social"></i>
        </a>
      </div>
      <div className="container text-center fixed-bottom">
        <small>2020 Cooper Yeh &copy; BLUXURY CATERING</small>
      </div>
    </footer>
  );
}

export default Footer;
